      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "In all the relations of his life, in all states or conditions of men, we feel the truth of this; and I would to Heaven that our readers could see as plainly what is of infinitely more importance to them, that no change of heart is equivalent to, or can be substituted for, a change of state! A change of heart is the result  of a change of views,  and  whatever  can  accomplish  a  change  of  views  may accomplish  a  change  of  heart  or  feeling,  but  a  change  of  state always calls for something more.28"
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "Lavinia was the servant of Palemon, and once thought him a hard master. She changed her views of him, and her feelings were also changed towards him; still, however, she continued in the state of a hand maid. Palemon offered her first his heart, and then his hand, and she accepted them. He vowed and she vowed before witnesses, and she became his wife. Then, and not till then, was her state changed. She is no longer a "
        ),
        _c("em", [_vm._v("servant")]),
        _vm._v(" — she is now a "),
        _c("em", [_vm._v("wife.")]),
        _vm._v(
          " A change of views and of feelings led to this change in state; but let it be noted  that  this  might  not  have  issued  in  a  change  of  state;  for Maria, who was another handmaid of Palemon, and changed her views of him and her feelings towards him as much — nay, more than did  Lavinia;  yet  Maria lived and died the servant maid of Palemon and Lavinia."
        ),
      ]),
