      _vm._v(" "),
      _c("p", [
        _vm._v(
          "A thousand analogies might be adduced, to show that though a change  of  state  often — nay,  generally  results  from  a  change  of feelings, and this from a change of views, yet a change of state does not generally follow, and is something quite different from, and cannot be identified with a change of heart. So in religion, a man may change his views of Jesus, and his heart may be changed towards  him;  but  unless  a  change  of  state  ensures,  he  is  still unpardoned,  unjustified,  unsanctified,  unreconciled,  unadopted, and lost to all Christian life and enjoyable. For it has been proved that these terms represent states and not feelings, condition and not character; and that a change of views or of heart, is not a change of state. To change a state is to pass into a new relation, and relation is  not  sentiment  nor  feeling.  Some  "
