      _c("p", [
        _vm._v(
          "To  perceive  what  this  act  of  faith  is,  it  must  be  remarked  that where there is no "
        ),
        _c("em", [_vm._v("command")]),
        _vm._v(" there can be no "),
        _c("em", [_vm._v("obedience.")]),
        _vm._v(
          " These are correlate  terms.  A  message  or  proclamation  which  has  not  a command in it, cannot be obeyed. But the gospel can be obeyed or disobeyed, and therefore in it there is a command. Lest any person should hesitate in a matter of such importance, we will prove,"
        ),
      ]),
    ]
  )
}
